import React from 'react'
import './App.css'
import styled from 'styled-components'

const Site = styled.div`
  width: 400px;
  height: 400px;
  background-color: #dac;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-around;
`


function App () {
  return(
    <Site>
      <div>99 vezes</div>
      <button></button>
    </Site>
  ) 
}

export default App
